@musky_space ::meet mu69, the farthest world ever visited by a spacecraft, 6.6 billion km away.
we literally flew by there a few hours ago. 🥜💫 hello new (well very old) world!
.
here is 2014 mu69 as seen by nasa new horizons at new years 2019! these are the best pictures yet, but still not the best we'll get - at these distances, we've only downlinked 1% of the flyby data.
.
it's a a contact binary (aka two smaller worlds that have touched) and is likely one of the oldest and most primitive objects formed at the very beginning of the solar system!
.
