text:
@spacex's 1st crew dragon test flight 🚀 
the maiden flight of the crew #dragon capsule — an uncrewed test mission to the international space station (@iss) called demo-1 — is scheduled to launch in jan. nasa officials announced (nov. 21).
crew dragon will lift off atop a spacex falcon 9 rocket from the historic launch complex 39a at nasa's kennedy space center in florida.nasa is counting on spacex and boeing to end the united states' dependence on russian soyuz rockets and spacecraft to get astronauts to and from the orbiting lab. this has been the situation since july 2011, when nasa grounded its space shuttle fleet after 30 years of operation.
.
.
